import styles from "./Investment.module.css";
import image1 from "../investment_logo.png";

const Investment = () => {
  return (
    <>
      <img src={image1} />
      <div>
        <h3>7AC TECHNOLOGY LLC</h3>
        <p>
          7AC offers a new approach to air conditioning technology, developing
          extreme energy savings and the ability to maximize climate friendly
          refrigerants
        </p>
      </div>
    </>
  );
};

export default Investment;
